import Logo from "./Logo";

function Footer() {
  return (
    <footer>
      <Logo />
      <div className="socials">
        <i class="fa-brands fa-instagram"></i>
        <i class="fa-brands fa-facebook-f"></i>
      </div>
      <div className="about"></div>
      <div className="links"></div>
    </footer>
  );
}

export default Footer;
